import {
  Cloud,
  DollarSign }
from 'react-feather'
export default [
  {
    id: 'publish',
    title: 'Publish',
    icon: <Cloud />,
    children: [
      {
        id: 'pricing',
        title: 'Pricing',
        icon: <DollarSign />,
        navLink: '/pages/pricing'
      },
      {
        id: 'pricing',
        title: 'Pay with Faris',
        icon: <DollarSign />,
        navLink: '/pages/fari-payment'
      },
      {
        id: 'pricing',
        title: 'Pay with STX',
        icon: <DollarSign />,
        navLink: '/pages/payment'
      }
   ]
  }
]
